import React from 'react'

const Test = (prop) => {
    prop.data.map((r) => {
        console.log(r);
    })
  return (
       prop.data.map((r, index) => {
        return (
            <div>

                <h1>{r.id}</h1>
                <h1>{r.first_name}</h1>
                <h1>{r.last_name}</h1>
                <h1>{r.address}</h1>
            </div>
        )
       }) 
  )
}

export default Test
